INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 1, 119901, 0, 1, "2023/12/27 11:59:59", 450, 0, 1, 119901, "ミヤコ（クリスマス）", 119901, 2.17, 1, "みやこ", 0, "2023/12/22 12:00:00", "【物理】中衛で、味方をプリンで強化する幽霊聖少女。\n物理攻撃力と物理クリティカルアップのプリンパワーの\nフィールドで自分のスキルも強化し、猛攻を繰り出す。", 119901, 0, 3, 302, 0, 14);
INSERT INTO `v1_d8ca938c93d44afba6708823bfe93f241e4afdbeecc2b41e523794b21927fed0` VALUES (0, 5, 120001, 0, 1, "2024/03/28 11:59:59", 450, 0, 5, 120001, "シズル（ノワール）", 120001, 2.375, 1, "しずる", 0, "2024/03/22 12:00:00", "【物理】前衛で猛攻から味方を守護する闇のお姉ちゃん。\nバトル開始時の行動不能無効スキルで周囲の味方を守り、\n範囲を束縛するスキルで敵を牽制し、戦況を一変する。", 120001, 0, 3, 190, 0, 6);
